import React, { Component } from 'react'
import Presentation from './Presentation'
import Projects from './Projects'
import Footer from '../components/Footer'
import Swiper from './Swiper'
import './Home.css';

class Home extends Component {
render() {
	return (
		<div className="home">
			<Presentation />
			<Swiper />
			<Projects />
			<Footer />
	</div>	
	)
}}

export default Home;
